import { GET_CLASS_LATEST, FETCHING_DATA, FETCH_DATA_SUCCESS } from './../constants/types';
import callAPI from './../common/callApi';

export const getClassLatest = () => dispatch => {
    dispatch({
        type: FETCHING_DATA
    });
    callAPI('/getClassLatest', 'GET', null)
        .then(res => {
            dispatch({
                type: GET_CLASS_LATEST,
                payload: res.data.classes
            });
            dispatch({
                type: FETCH_DATA_SUCCESS
            });
        });
};
